import React from 'react';
import {Link} from 'react-router-dom';

export default function EspecificacionesCompletas(){
  return(
    <div class = "especificacionesCompletadas">
      <h22>Especificaciones ingresadas exitosamente</h22>
      <Link to= "/buscador"><button class="pasarAlBuscador">Pasar al buscador</button></Link>
    </div>
);
}
